import React, {useEffect, useState} from 'react';
import axios from 'axios';

export default class UcmmKgCall extends React.Component{

    state = { 
        triples : []
    };

    requestOptions ={
        method: "Post",
        headers: {"Content-Type" : "application/json"},
    };


    componentDidMount(){
        axios.post(
            'http://13.38.36.148:8080/rdf4j-server/repositories/ucmm_instance_graph',
             {query : "select * where {?s ?p ?o} limit 10"},
              this.requestOptions ).then(
            res =>{
                console.log("res")
                console.log(res)

                console.log("res.data")
                console.log(res.data)

                const triples = res.data;
                this.setState({triples});
            }
        )
    }

    render(){
        return(
        <div>
            {this.state.triples ? (
                <table>
                    <tr>
                        <th>s</th>
                        <th>p</th>
                        <th>o</th>
                    </tr>
                    {this.state.triples.map((item) => (

                        <tr >

                            <td>item</td>


                        </tr>

                    ))}
                </table>
            ) : (
                <p>Loading...</p>
            )}
        </div>
        )
    }


}
